import React from "react";
import "./StoreHome.css";

function StoreHome() {
  return (
    <div id="store-home">
      <div id="header">
        <h1>Stores</h1>
        Meet the owners and learn more about our wonderful selection of local
        stores!
      </div>
    </div>
  );
}

export default StoreHome;
